import base64
background_png = ""
nplogo_svg = ""
inter_semibold_otf = ""

def decode(b64_string):
    return base64.b64decode(b64_string)

def make_file(name, data):
    try:
        with open(f"/opt/nativeplanet/groundseg/static/{name}", "wb") as f:
            f.write(data)
    except:
        return False

    return True

def make_if_valid(name):
    if name == 'Inter-SemiBold.otf':
        return make_file(name, decode(inter_semibold_otf))

    if name == 'background.png':
        return make_file(name, decode(background_png))

    if name == 'nplogo.svg':
        return make_file(name, decode(nplogo_svg))

    return False
        
